import React from 'react';
import { useNavigate } from 'react-router-dom';
import '../styles/Home.css';
import bananaa from '../assets/images/bananaa.jpg'; // Correct import

const Home = () => {
  const navigate = useNavigate();

  return (
    <div
      className="container"
      style={{
        backgroundImage: `url(${bananaa})`,
        backgroundSize: 'cover',
        backgroundPosition: 'center',
        backgroundRepeat: 'no-repeat',
        height: '100vh',
      }}
    >
      <h1>IQ-Based Math Game</h1>
      <p>Test and improve your problem-solving skills through fun and challenging math questions.</p>
      <button onClick={() => navigate('/signup')}>Play Game</button>
    </div>
  );
};

export default Home;
